New declaration +export interface PBLight {
+ color?: PBColor3 | undefined;
+ enabled?: boolean | undefined;
+ illuminance?: number | undefined;
+ shadows?: boolean | undefined;
+} Summary: The PBLight component introduces a flexible interface for defining light sources. Lights can be enabled or disabled, adjusted for brightness (illuminance), and set to cast or ignore shadows. Lights can be attached to non-root entities to simulate localized light effects like lamps or bulbs. The color property allows you to specify the light color using the PBColor3 format. Illuminance The illuminance property defines the light’s brightness in lux (lumens/m²). For global directional lights, this is applied uniformly. For point or spotlights, this specifies the illuminance at a 1m distance from the light source. Shadows The shadows property toggles whether a light casts shadows. The engine may limit the number of lights casting shadows based on performance settings.

