New Declaration +export interface PBSpotlight {
+ angle: number;
+ innerAngle?: number | undefined;
+} Summary: The PBSpotlight component turns a point light into a spotlight, emitting light in a cone defined by the angle property. Use the innerAngle property to define a smooth fall-off for light intensity within the spotlight cone. Spotlights are useful for simulating directional light sources like torches or headlights. Angle The angle property (in radians) defines the width of the cone in which the light is emitted. For example, a typical torch would have an angle of around 0.15. Inner Angle The innerAngle defines the core area of maximum brightness. The light intensity decreases smoothly between the innerAngle and angle.

